// src/App.jsx
import React from "react";
import Navside from "./layouts/Navside";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import TempMail from "./features/Temp/Tempmail";


const App = () => {
  return (
    <>
 <BrowserRouter>

        <Navside />

          <Routes>

            <Route path="/tempmail" element={<TempMail />} />

          </Routes>

    </BrowserRouter>
    </>
  );
};

export default App;
